const e=JSON.parse('{"key":"v-68377a31","path":"/Giser/Gis01.html","title":"WebGis","lang":"zh-CN","frontmatter":{"title":"WebGis","icon":"sitemap","date":"2024-03-12T00:00:00.000Z","category":["框架"],"tag":["gis"],"sticky":false},"headers":[{"level":2,"title":"什么是 WebGis？","slug":"什么是-webgis","link":"#什么是-webgis","children":[]},{"level":2,"title":"什么是 OpenLayers?","slug":"什么是-openlayers","link":"#什么是-openlayers","children":[]},{"level":2,"title":"核心类","slug":"核心类","link":"#核心类","children":[]},{"level":2,"title":"类的事件","slug":"类的事件","link":"#类的事件","children":[]},{"level":2,"title":"组件","slug":"组件","link":"#组件","children":[]}],"git":{"createdTime":1710423283000,"updatedTime":1710576523000,"contributors":[{"name":"rayadaschn","email":"115447518+rayadaschn@users.noreply.github.com","commits":2}]},"readingTime":{"minutes":3.86,"words":1157},"filePathRelative":"Giser/Gis01.md","localizedDate":"2024年3月12日","excerpt":"<p>在这一节里，回顾一遍 WeBGis 的一些相关概念。</p>\\n<h2> 什么是 WebGis？</h2>\\n<p>WebGIS（网络地理信息系统）是指基于网络平台，客户端应用软件采用网络协议，运行在网络上的地理信息系统，即将 GIS 所能提供的功能通过网络展现给用户。</p>\\n<blockquote>\\n<p>顾名思义，WebGIS 就是展现在网络上的 GIS，是 GIS 与 Web 融合的产物。GIS 通过 Web 功能得以扩展，使得 GIS 冲破专业圈子，真正成为大众化的 GIS。</p>\\n</blockquote>\\n<h2> 什么是 OpenLayers?</h2>\\n<p>OpenLayers 是一个专门为 WebGIS 客户端提供的 JavaScript 类库。用于访问以标准格式发布的地图数据，实现访问空间数据的方法都符合行业标准，支持各种公开的和私有的数据标准和资源。</p>"}');export{e as data};
